import logo from './logo.svg';
import './App.css';
import React from 'react';

class Navbar extends React.Component{
  
    constructor(props){
        super(props);
        this.state = {
            renderNavbar: true
        }
    }

    render(){
        if(this.state.renderNavbar != true){
            return null;
        }
        return(
            <nav class="navbar  navbar-expand -lg navbar-dark bg-dark">
                <div class="container-fluid">
                    <a class="navbar-brand" href="#">Finn</a>
                    <div class="collapse navbar-collapse" id="navbarSupportedContent">
                        <div class="form-group w-75 me-auto mb-2 mb-lg-0 mx-auto ">
                                <form class="d-flex">
                                    <input class="form-control me-2" type="search" placeholder="Search any product..." aria-label="Search"/>
                                    <button class="btn btn-outline-primary" type="submit">Search</button>
                                </form>
                        </div>
                        <div class="dropdown">
                            <a class="nav-link dropdown-toggle" href="#"  role="button" data-bs-toggle="dropdown" aria-expanded="false">
                                <img src={logo} alt="" width="30" height="24" class="d-inline-block align-text-top"/>
                                Profile
                            </a>
                            <ul class="dropdown-menu" aria-labelledby="navbarDropdown">
                                <li><a class="dropdown-item" href="#">Action</a></li>
                                <li><a class="dropdown-item" href="#">Another action</a></li>
                                <li><a class="dropdown-item" href="#">Something else here</a></li>
                            </ul>           
                        </div>
                    </div>
                </div>
            </nav>
        );
    }
}

export default Navbar;
